import styles from './AddUser.module.css';

import Card from '../UI/Card';

const AddUser = () => {
  const addUserHandler = (event) => {
    event.preventDefault();
  };

  return (
    <Card>
      <form onSubmit={addUserHandler}>
        <label className={styles.input} htmlFor="username">
          Username
        </label>
        <input className={styles.input} id="username" type="text"></input>
        <label className={styles.input} htmlFor="age">
          Age (Years)
        </label>
        <input className={styles.input} id="age" type="number"></input>
        <button className={styles.input} type="submit">
          Add User
        </button>
      </form>
    </Card>
  );
};

export default AddUser;
